  input: TEXT,F3XA,,"This amendment responds to your letter of December 29, 2004.
    We have clarified the receipt from a federal candidate committee on Schedule A
    for Line 15 and the related disbursement on Schedule B for Line 21b. Please see
    the separate text notes on those transactions. The payments on Schedule H6 for
    Planning & Consulting, Pct. Coordination, Campus Coordination, and Volunteer Coor.
    & Expenses were to individuals who are not employees of the committee. These are
    self-employed individuals. The payments on Schedule H6 for Phone Calls and Vote
    By Mail mailer were not public communications on behalf of any federal candidate.
    They did not promote, support, attack or oppose any candidate. In reviewing our
    records and preparing this amendment, we found that a nonfederal transfer and
    a Levin transfer had been omitted from the report. We have reported those transfers
    on this amendment. We have also reported a number of unitemized contributions
    that were received online via credit card and were overlooked when the report
    was originally prepared."
